import React from 'react'
import './Footer.css'
function Footer() {
  return (
    <div className='FooterContainer'>
        <div>
            <ul>
                // eslint-disable-next-line
                <li>About</li>
                // eslint-disable-next-line
                <li>Feature</li>
                // eslint-disable-next-line
                <li>Pricing</li>
                // eslint-disable-next-line
                <li>Careers</li>
                // eslint-disable-next-line
                <li>Help</li>
                // eslint-disable-next-line
                <li>Privacy Policy</li>
            </ul>
        </div>
    </div>
  )
}

export default Footer
